import React from 'react';

const Attendants = (props) => {
    return (
        <div style={{
            position: 'absolute',
            marginLeft: '40%', 
            }}>
            I can attend to the tasks
            <span style={{textAlign: 'left'}}>
                {props.children}
            </span>
        </div>
    );
};

export default Attendants;
